using AOLadderer.ClusterTemplates;
using AOLadderer.Stats;
using System.Collections.Generic;
using System.Linq;

namespace AOLadderer
{
    public class ImplantTemplate
    {
        private ImplantTemplate(
            int aoid, ImplantSlot implantSlot, Ability requiredAbility,
            ShinyClusterTemplate shinyClusterTemplate,
            BrightClusterTemplate brightClusterTemplate,
            FadedClusterTemplate fadedClusterTemplate)
        {
            AOID = aoid;
            ImplantSlot = implantSlot;
            RequiredAbility = requiredAbility;
            ShinyClusterTemplate = shinyClusterTemplate;
            BrightClusterTemplate = brightClusterTemplate;
            FadedClusterTemplate = fadedClusterTemplate;
            RaisedLadderStats = new ClusterTemplate[] { ShinyClusterTemplate, BrightClusterTemplate, FadedClusterTemplate }
                .Where(t => t?.RaisesLadderStat ?? false)
                .Select(t => t.Stat)
                .ToArray();
            AbilityClusterTemplates = new ClusterTemplate[] { ShinyClusterTemplate, BrightClusterTemplate, FadedClusterTemplate }
                .Where(t => t?.RaisesAbility ?? false)
                .ToArray();
            TreatmentClusterTemplate = new ClusterTemplate[] { ShinyClusterTemplate, BrightClusterTemplate, FadedClusterTemplate }
                .Where(t => t?.RaisesTreatment ?? false)
                .SingleOrDefault();
        }

        public int AOID { get; }
        public ImplantSlot ImplantSlot { get; }
        public Ability RequiredAbility { get; }
        public ShinyClusterTemplate ShinyClusterTemplate { get; }
        public BrightClusterTemplate BrightClusterTemplate { get; }
        public FadedClusterTemplate FadedClusterTemplate { get; }
        public bool RaisesLadderStats => RaisedLadderStats.Any();
        public IReadOnlyList<Stat> RaisedLadderStats { get; }
        public IReadOnlyList<ClusterTemplate> AbilityClusterTemplates { get; }
        public ClusterTemplate TreatmentClusterTemplate { get; }
        public Stat ShinyStat => ShinyClusterTemplate?.Stat;
        public Stat BrightStat => BrightClusterTemplate?.Stat;
        public Stat FadedStat => FadedClusterTemplate?.Stat;

        public static ImplantTemplate GetImplantTemplate(ImplantSlot implantSlot, Stat shinyStat, Stat brightStat, Stat fadedStat)
            => implantSlot.ImplantTemplates
            .Single(t => t.ShinyStat == shinyStat
                && t.BrightStat == brightStat
                && t.FadedStat == fadedStat);

