            => $"{ImplantSlot.Name} Implant ({RequiredAbility}): {ShinyClusterTemplate?.Stat.Name ?? "Empty"}, {BrightClusterTemplate?.Stat.Name ?? "Empty"}, {FadedClusterTemplate?.Stat.Name ?? "Empty"}";

