        private static IEnumerable<ImplantTemplate> ComputeImplantTemplates()
        {
            int implantTemplateIndex = 0;
            foreach (var implantSlot in ImplantSlot.ImplantSlots)
            {
                foreach (var shinyClusterTemplate in implantSlot.ShinyClusterTemplates.Prepend(null))
                {
                    foreach (var brightClusterTemplate in implantSlot.BrightClusterTemplates.Prepend(null))
                    {
                        foreach (var fadedClusterTemplate in implantSlot.FadedClusterTemplates.Prepend(null))
                        {
                            if (shinyClusterTemplate == null
                                && brightClusterTemplate == null
                                && fadedClusterTemplate == null)
                                continue;

                            yield return new ImplantTemplate(
                                ImplantTemplateAOIDs[implantTemplateIndex],
                                implantSlot,
                                Ability.Abilities[ImplantTemplateRequiredAbilityIndexes[implantTemplateIndex]],
                                shinyClusterTemplate,
                                brightClusterTemplate,
                                fadedClusterTemplate);
                            ++implantTemplateIndex;
                        }
                    }
                }
            }
        }
        public static readonly IReadOnlyList<ImplantTemplate> ImplantTemplates = ComputeImplantTemplates().ToArray();
